import React from "react";
import { Container } from "react-bootstrap";
import Topbar from "./Navbar";
import "./style.css";
import { Display } from "react-bootstrap";



const Back = () => {
    return (
        <div className="cover">
            <div className="cover_overlay">
            <Topbar />

            <Container className="text-white" style={{zIndex: "2", padding: "200pt"}}>
                <h1>The Ultimate Site</h1>

            </Container>
            </div>
        </div>
    )
}

export default Back;
